import Container from "react-bootstrap/esm/Container";
import Header from "../components/Header";

const About = () => {
    
    return (
        <div>
        <Header/>
<Container>
        <h1>About</h1>
        <p>
            This is a recipe website. It is a project that I have created to learn
            React.
        </p>
        </Container>
        </div>
     
    );
}

export default About;
